import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './index.css'; // Global styles

const Rating = ({ role }) => {
  const [items, setItems] = useState([]); // students for lecturer, lectures for student
  const [ratings, setRatings] = useState([]);
  const [form, setForm] = useState({ item_id: '', rating: '', comment: '' });
  const [message, setMessage] = useState('');

  // Handle form input changes
  const handleChange = (e) => setForm({ ...form, [e.target.name]: e.target.value });

  // Fetch students (lecturer) or lectures (student)
  useEffect(() => {
    const fetchItems = async () => {
      try {
        const token = localStorage.getItem('token');
        let res;

        if (role === 'lecturer' || role === 'pl') {
          res = await axios.get(`${process.env.REACT_APP_API_URL}/lectures/me/students`, {
            headers: { 'x-auth-token': token }
          });
        } else if (role === 'student') {
          res = await axios.get(`${process.env.REACT_APP_API_URL}/students/me/lectures`, {
            headers: { 'x-auth-token': token }
          });
        }

        setItems(res.data || []);
      } catch (err) {
        console.error('Fetch items error:', err);
      }
    };
    fetchItems();
  }, [role]);

  // Handle submit rating
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(`${process.env.REACT_APP_API_URL}/rating`, form, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setMessage(res.data.message);
      setForm({ item_id: '', rating: '', comment: '' });
    } catch (err) {
      setMessage(err.response?.data?.message || 'Error submitting rating');
      console.error(err);
    }
  };

  return (
    <div className="rating-container">
      <h3>{role === 'lecturer' || role === 'pl' ? 'Rate Students' : 'Rate Lectures'}</h3>
      {message && <p className="message">{message}</p>}

      <form className="rating-form" onSubmit={handleSubmit}>
        <select name="item_id" value={form.item_id} onChange={handleChange} required>
          <option value="">
            Select {role === 'lecturer' || role === 'pl' ? 'Student' : 'Lecture'}
          </option>
          {items.map((item) => (
            <option key={item.id} value={item.id}>
              {role === 'lecturer' || role === 'pl' ? item.name : `${item.course_name} (${item.course_code})`}
            </option>
          ))}
        </select>

        <input
          type="number"
          name="rating"
          placeholder="Rating (1-5)"
          min="1"
          max="5"
          value={form.rating}
          onChange={handleChange}
          required
        />

        <textarea
          name="comment"
          placeholder="Optional comment"
          value={form.comment}
          onChange={handleChange}
        />

        <button type="submit">Submit Rating</button>
      </form>

      <h4>All Ratings</h4>
      <div className="ratings-list">
        {ratings.length > 0 ? (
          ratings.map((r) => (
            <div key={r.id} className="rating-card">
              <p>
                <strong>Lecture ID:</strong> {r.lecture_id}
              </p>
              <p>
                <strong>Student ID:</strong> {r.student_id}
              </p>
              <p>
                <strong>Lecturer ID:</strong> {r.lecturer_id}
              </p>
              <p>
                <strong>Rating:</strong> {r.rating}
              </p>
              <p>
                <strong>Comment:</strong> {r.comment || '-'}
              </p>
            </div>
          ))
        ) : (
          <p>No ratings yet.</p>
        )}
      </div>
    </div>
  );
};

export default Rating;
